import Header from "./components/Header";
import Main from "./components/Main";

function App() {
  const handleLogoClick = () => {
    // Reset the state to default
    setSearchResult(null);
    setNoResults(false);
  };
  return (
    <>
      <Header onLogoClick={handleLogoClick}  />
      <Main />
    </>
  );
}

export default App;
